import React from 'react';
import {Link} from 'react-router-dom';

const Header = () => {
    // const loggingIn = localStorage.getItem('user-token');
    // if(!loggingIn){
    //   this.props.history.push("/");
    // }
        return (
            <nav className="navbar navbar-inverse border-0" style={{border:"none"}}>
                <div className="container-fluid">
                    <div className="navbar-header">
                    <a className="navbar-brand" href="#">My Contacts List</a>
                    </div>
                    <ul className="nav navbar-nav navbar-right">
                    <li><a href="#"><span className="glyphicon glyphicon-user" /> Add Contact</a></li>
                    <li><a href="#"><span className="glyphicon glyphicon-log-in" /> Logout</a></li>
                    <li><Link to="/" className="navbar-brand"><span className="glyphicon glyphicon-user" /> Add Contact</Link></li>
                    <li><Link to="/logout" ><span className="glyphicon glyphicon-log-in" /> Logout</Link></li>
                    </ul>
                </div>
            </nav>
        );

}

export default Header;
